import '../App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Divider from '@mui/material/Divider';
import { motion } from 'framer-motion';
import { Image } from 'react-bootstrap';
import zadyn_pic from '../images/zadyn_pic.jpg';
// import StackedNavbar from '../StackedNavbar';

function Developers() {
  return (
    <motion.div 
      className='body-main'
      initial= {{opacity: 0}}
      animate = {{opacity: 1}}
      transition={{duration: 0.5, ease: 'easeOut'}}
      exit={{opacity: 0}}
    >
      <h1>Developers</h1>
      <Divider
        variant='middle'
        sx={{
          borderColor: 'white',
          width: '100%'
        }}
      >
      </Divider>
      <br></br>
      <div>
        <h3 style={{textWrap: 'wrap'}}>
        Meet the developers!
        </h3>
        {/* <Image src={zadyn_pic} style={{height: '180px', width: '171px'}} roundedCircle/> */}
        {/* <h5 className='highlight-text'>
          Zadyn Belgrave
        </h5> */}
      </div>
      <br></br>
      <Divider
        variant='middle'
        sx={{
          borderColor: 'white',
          width: '100%'
        }}
      >
      </Divider>
      <div>
        <div>
          <Image src={zadyn_pic} style={{height: '180px', width: '171px'}} roundedCircle/>
        </div>
        <p>
          How many times were you frustrated while looking
          out for a good collection of programming/algorithm
          /interview questions? What did you expect and what
          did you get? This portal has been created to
          provide well written, well thought and well
          explained solutions for selected questions.
          An IIT Roorkee alumnus and founder of GeeksforGeeks.
          He loves to solve programming problems in most
          efficient ways. Apart from GeeksforGeeks, he has
          worked with DE Shaw and Co. as a software developer
          and JIIT Noida as an assistant professor. It is a
          good platform to learn programming. It is an
          educational website. Prepare for the Recruitment
          drive of product based companies like Microsoft,
          Amazon, Adobe etc with a free online placement
          preparation course.
        </p>
      </div>
      {/* <StackedNavbar capacity='3' items='Developers, Projects, GitHub' /> */}
    </motion.div>
  );
}

export default Developers;
